Destructuring assignment is a counterpart to destructuring pattern matches for variable declaration, permitting assignment to complex values, such as tuples or structs. For instance, we may swap two mutable variables: let (mut a, mut b) = (0, 1);
// Swap `a` and `b` using destructuring assignment.
(b, a) = (a, b); In contrast to destructuring declarations using let, patterns may not appear on the left-hand side of an assignment due to syntactic ambiguities. Instead, a group of expressions that correspond to patterns are designated to be assignee expressions , and permitted on the left-hand side of an assignment. Assignee expressions are then desugared to pattern matches followed by sequential assignment. The desugared patterns must be irrefutable: in particular, this means that only slice patterns whose length is known at compile-time, and the trivial slice [..], are permitted for destructuring assignment. The desugaring method is straightforward, and is illustrated best by example. # struct Struct { x: u32, y: u32 }
# let (mut a, mut b) = (0, 0);
(a, b) = (3, 4); [a, b] = [3, 4]; Struct { x: a, y: b } = Struct { x: 3, y: 4}; // desugars to: { let (_a, _b) = (3, 4); a = _a; b = _b;
} { let [_a, _b] = [3, 4]; a = _a; b = _b;
} { let Struct { x: _a, y: _b } = Struct { x: 3, y: 4}; a = _a; b = _b;
} Identifiers are not forbidden from being used multiple times in a single assignee expression. Underscore expressions and empty range expressions may be used to ignore certain values, without binding them. Note that default binding modes do not apply for the desugared expression.

